import React, { useState } from "react";
import {
  Tabs,
  Button,
  Modal,
  Form,
  Input,
  InputNumber,
  Typography,
  Upload,
  Icon
} from "antd";
import LectureRoomList from "./LectureRoomList";

const { TabPane } = Tabs;
const { Text } = Typography;

const BuildingList = () => {
  const [visible, setVisible] = useState(false);

  const showModal = () => {
    setVisible(true);
  };
  const handleSubmit = e => {
    e.preventDefault();
    setVisible(false);
  };

  const handleCancel = () => {
    setVisible(false);
  };

  const props = {
    action: "//jsonplaceholder.typicode.com/posts/",
    listType: "picture",
    previewFile(file) {
      console.log("Your upload file:", file);
      // Your process logic. Here we just mock to the same file
      return fetch("https://next.json-generator.com/api/json/get/4ytyBoLK8", {
        method: "POST",
        body: file
      })
        .then(res => res.json())
        .then(({ thumbnail }) => thumbnail);
    }
  };

  return (
    <>
      <Modal title="강의실 추가" visible={visible} footer={null}>
        <Form onSubmit={handleSubmit}>
          <Form.Item>
            <Upload>
              <Button>
                <Icon type="upload" /> Click to Upload
              </Button>
            </Upload>
          </Form.Item>
          <Form.Item>
            <Input addonBefore="강의실 코드" style={{ width: "50%" }} />
          </Form.Item>
          <Form.Item>
            <Input addonBefore="강의실명" style={{ width: "50%" }} />
          </Form.Item>
          <Form.Item>
            <div>
              <Text type="secondary">최대 인원수 : </Text>
              <InputNumber
                min={3}
                max={30}
                defaultVAlue={3}
                style={{ width: "50%" }}
              />
            </div>
          </Form.Item>
          <Form.Item>
            <Button
              type="primary"
              style={{ marginRight: "20px" }}
              htmlType="submit"
            >
              추가
            </Button>
            <Button type="danger" onClick={handleCancel}>
              취소
            </Button>
          </Form.Item>
        </Form>
      </Modal>
      <Tabs
        defaultActiveKey="11"
        style={{ marginTop: "70px", textAlign: "center" }}
      >
        <TabPane tab="승연관" key="1"></TabPane>
        <TabPane tab="일만관" key="2"></TabPane>
        <TabPane tab="월당관" key="3"></TabPane>
        <TabPane tab="나눔관" key="5"></TabPane>
        <TabPane tab="이천환관" key="6"></TabPane>
        <TabPane tab="새천년관" key="7"></TabPane>
        <TabPane tab="성미가엘성당" key="9"></TabPane>
        <TabPane tab="미가엘관" key="11">
          <Button
            style={{ marginBottom: "20px", textAlign: "right" }}
            type="primary"
            onClick={showModal}
          >
            강의실 추가
          </Button>
          <LectureRoomList />
        </TabPane>
      </Tabs>
    </>
  );
};
export default BuildingList;
